 .variations_button[style*="display:none;"]+div {
   color: red;
 } <div class="variations_button" style="display: none;">asd</div>
 <div>test</div>  Of course, it remains much simpler to use classes to hide an element, toggling that class with JavaScript, and using the class as part of the CSS selector, for example:  $('.variations_button + div').on('click', function() {
   $('.variations_button').toggleClass('hidden');
 }); .hidden {
   display: none;
 }
